import React from 'react';
import loslagos_1 from './img/loslagos_1.png';
import loslagos_2 from './img/loslagos_2.png';
import Contacto from './pages/Contacto'

export default function Home() {

    function over(e) {
        e.currentTarget.src = loslagos_2;
    }

    function out(e) {
        e.currentTarget.src = loslagos_1;
    }

    function imageClick(e) {
        console.log('Click!!!!');
    }       


    return (
        <div className='/'>

            <img
                src={loslagos_1}
                onClick={ imageClick}
                onMouseOver={over}
                onMouseOut={out}
                alt='Regiï¿½n de los Lagos'
            />
        </div>
    );
}
